  return (
    <div className="App">
      <FetchSchedules />
      <button type="button" onClick={getSchedules}>get schedules</button>
      <button type="button" onClick={() => console.log(toJS(schedules))}>console schedules</button>
      <Finder setParams={setParams} />
      {Object.values(params).length > 0 && <Schedule />}
    </div>
  );
}

export default observer(App);
